import React, { useState } from "react";
import Dropdown from 'react-bootstrap/Dropdown';
import { useNavigate } from "react-router-dom";

import "../../styles/compStyles/navbar.css";
export default props => {
    const [show,setShow] = useState(false);
    const navigate = useNavigate();
    const handleMenuClick = () => {
        setShow(!show);
    }
    const handleItemClick = e => {
        console.log(e.target)
        if (e.target.eventKey === 1){

            navigate('/home');
        } else {
            navigate('/login');
            
        }
    }
    return (
        <>
            <div className="navbarwrap">
                <div className="topbar"></div>
                <button className="navdropdown dropdown" onClick={handleMenuClick}>
                    <div className="navtitlewrap">
                        {/* Navbar.Brand for icon */}
                        <h1 className="navtitle">StellarMe</h1>
                    </div>
                    {show ? 
                    <Dropdown.Menu show variant="dark" className="dropmenu" id="menu">
                        <Dropdown.Item eventKey="1" onClick={e=>handleItemClick(e)}>Home</Dropdown.Item>
                        <Dropdown.Item eventKey="2" onClick={e=>handleItemClick(e)}>Register</Dropdown.Item>
                        <Dropdown.Item eventKey="3" onClick={e=>handleItemClick(e)}>Login</Dropdown.Item>
                        <Dropdown.Divider />
                        <Dropdown.Item eventKey="4" onClick={e=>handleItemClick(e)}>Preview</Dropdown.Item>
                    </Dropdown.Menu>
                    : 
                    <Dropdown.Menu variant="dark" className="dropmenu" id="menu">
                        <Dropdown.Item eventKey="1" onClick={e=>handleItemClick(e)}>Action</Dropdown.Item>
                        <Dropdown.Item eventKey="2" onClick={e=>handleItemClick(e)}>Another action</Dropdown.Item>
                        <Dropdown.Item eventKey="3" onClick={e=>handleItemClick(e)}>Something else here</Dropdown.Item>
                        <Dropdown.Divider />
                        <Dropdown.Item eventKey="4" onClick={e=>handleItemClick(e)}>Separated link</Dropdown.Item>
                    </Dropdown.Menu>
                    }
                </button>
            </div>
        </>
    )
}
